import { Fragment, FunctionComponent } from "react";

import PageHeader from "../Components/Atoms/PageHeader";
import ReactPlayer from 'react-player';

import image from "../Assets/Images/2018-12-28.jpg";
import image2 from "../Assets/Images/home-cover.jpg";
import image3 from "../Assets/Images/IMG_20210629_184725.jpg";

const AboutUs: FunctionComponent = () => {
    return (
        <Fragment>
            <PageHeader title='Over Ons' /><div className="page-container">
                <div className="flex flex-col md:flex-row gap-5">
                    <div className="w-full md:w-1/2">
                        <p>
                        https://www.twitch.tv/riotgames
                        </p>
                    <div>
                    <ReactPlayer url="https://www.twitch.tv/riotgames" playing controls />
                    </div>

                    </div>
                    <div className="w-full md:w-1/2 flex flex-col gap-y-5">
                        <img src={image} />
                        <img src={image2} />
                        <img src={image3} />
                    </div>
                </div>
            </div>
        </Fragment>
    );
}

export default AboutUs;
